(1, 'Cambodia Set to Take Global Stage Again as ASEAN Chair', 'For the next 365 days, every move Cambodia, especially Prime Minister Hun Sen, makes or takes will be scrutinized by strategists and political pundits around the world. Phnom Penh will be the new fulcrum in the post-pandemic era to which global leaders can converge and discuss their future, which could further intensify cooperation or tension. After nearly four decades of continuous power, Hun Sen’s brinkmanship is well known and most of all, he knows exactly what he wants to say and do. Uniquely, none of the regional leaders knows the region’s pulse and global politics as well as Hun Sen.', NULL, 1, 1, '0', '2021-11-03 19:11:54'),
(2, 'Huawei Promotion', 'In a media statement on Tuesday (July 30), the company explained that for the promotion on July 26, it had prepared about 2,000 sets of the Y6 Pro smartphones, to be sold at a discounted price of S$54.\r\nRead more at https://www.todayonline.com/singapore/huawei-offers-s100-voucher-5000-customers-make-things-right-after-botched-promotion', NULL, 1, 5, '0', '2021-11-03 19:12:37'),
(3, 'Antonio Conte: Tottenham head coach vows to bring consistency and play attractive football', 'Antonio Conte has signed an 18-month deal at the Tottenham Hotspur Stadium, replacing Nuno Espirito Santo who was sacked on Monday; Conte took charge of his first Spurs training session on Tuesday; \"My coaching philosophy is very simple - to play good and attractive football for our fans\"', NULL, 3, 3, '0', '2021-11-03 19:13:52'),
(4, 'အဖေဖြစ်သူရဲ့အသင်းက ငြင်းပယ်လိုက်ပေမယ့် ကိုယ်ပိုင်အစွမ်းနဲ့ တောက်ပလာတဲ့ Olmo', 'လာမာစီယာအကယ်ဒမီက အဓိကသင်ကြားပေးခဲ့တဲ့ ကတ်တလန်နွယ်ဖွား၊ ဘာစီလိုနာမြို့သားလေးဟာ ဥရောပမှာ နာမည်ကျော်ကြားလာခဲ့ပါတယ်။ အသက် ၂၃ နှစ်ပဲရှိသေးတဲ့ လူငယ်တိုက်စစ်မှူးတစ်​ယောက်ရဲ ခြေစွမ်းခြေစဟာ ဥရောပထိပ်သီးအသင်းကြီးတွေရဲ့ မျက်စ,ပစ်စရာဖြစ်လာခဲ့တယ်။ အက်စ်ပန်ညိုအကယ်ဒမီကနေ အိမ်နီးချင်း ဘာစီလိုနာရဲ့ လာမာစီယာကို ပြောင်းရွှေ့သင်ကြားခဲ့ပြီးနောက် ဘာစီလိုနာက အနာဂတ်အတွက် မရည်ရွယ်ခဲ့ပုံရပါတယ်။ အသက် ၁၆ နှစ်ပဲရှိသေးတဲ့ Olmo ကို ဒိုင်နမိုဇာဂရက်ဘ်ဆီ ထွက်ခွာခွင့်ပြုခဲ့တယ်။ လာမာစီယာမှာ ပညာရည်ပြည့်ဝလာတဲ့ Olmo ဟာ ဒိုင်နမိုဇာဂရက်ဘ်အကယ်ဒမီမှာ တစ်ရာသီသာ သင်ကြားခဲ့ပြီးနောက် အရံသင်းမှာ ပွဲထွက်ခွင့်ရခဲ့တယ်။\r\nကွင်းလယ်နဲ့ တောင်ပံတိုက်စစ်နေရာစုံမှာ ကစားနိုင်တဲ့ Olmo ဟာ အရံအသင်းမှာ ၂၅ ပွဲကစားပြီး ၃ ဂိုးသာသွင်းနိုင်ခဲ့ပေမယ့် အသင်းကြီးရောက်တော့ ပွဲ ၈၀ မှာ ဂိုး ၂၀ သွင်းယူနိုင်ခဲ့ပါတယ်။ အဖေဖြစ်သူက မထင်မရှား ဘောလုံးသမားတစ်ယောက်လည်းဖြစ်သလို နည်းပြတစ်ယောက်လည်းဖြစ်ပါတယ်။ စပိန်နဲ့ ခရိုအေးရှား သွေးနှောထားတဲ့ စပိန်နိုင်ငံသားလေးဟာ အကိုဖြစ်သူ Carlos နဲ့အတူ အဖေဖြစ်သူရဲ့ ပွဲစဥ်တွေကို လိုက်ကြည့်လေ့ရှိတယ်။ သူ့အဖေလို ဘောလုံးကစားချင်တဲ့ ကောင်လေးဟာ သူ့အဖေရဲ့ အသင်း Terrassa FC မှာ စာရင်းပေးသွင်းခဲ့ပေမယ့် အသက်အရွယ်ငယ်ရွယ်တယ်ဆိုတဲ့ ေအကြောင်းပြချက်နဲ့ လက်မခံခဲ့ကြဘူး။ သူ အဲဒီလို စာရင်းသွားပေးတဲ့အချိန်မှာ သူ့အဖေက အဲဒီ Terrassa FC အသင်းရဲ့ နည်းပြဖြစ်နေပြီ။ အဖေဖြစ်သူနဲ့ ရွေးချယ်ရေးအဖွဲ့တွေရဲ့ ငြင်းပယ်ခြင်းခံခဲ့ရတဲ့ကောင်လေးဟာ သူရဲ့ လုပ်နိုင်စွမ်းကို တခြားအသင်းဖြစ်တဲ့ အက်စ်ပန်ညိုနဲ့ စတင်ခဲ့ရတယ်။', NULL, 5, 3, '0', '2021-11-04 06:29:20'),
(5, 'ဆည်းဆာချိန်ထိ တောက်ပနေဆဲ ဘောလုံးနတ်ဘုရားကြီး ဇလာတန် အီဗရာဟီ မိုဗစ်', 'လူဘဝ ဆိုတာ အသက် (၄၀) မှစတယ်လို့ ဆိုရိုးရှိပေမယ့် ဘောလုံးအားကစားလို ရုပ်ပိုင်းဆိုင်ရာ ကြံခိုင်မှု ကို မြင့်မြင့်မားမား တောင်းဆိုတဲ့ ကစားနည်းမျိုးရဲ့ ပရော်ဖက်ရှင်နယ်အဆင့် မှာ အသက် (၄၀) ဆိုတာ နေဝင်ချိန်ရဲ့ တစ်ဖက်ကမ်းကိုတောင်ရောက်နေပါပြီ။ မော်ဒန်ဘောလုံးလောကရဲ့ ထိပ်တန်း လိဂ်ပြိုင်ပွဲတွေမှာ အသက် (၄၀) အရွယ်အထိ ဘောလုံးကစားခဲ့တဲ့ ဘောလုံးသမားတွေ မရှိဘူး မဟုတ်၊ ရှိပါတယ်။ ဒါပေမယ့် အသက် (၄၀) အထိ ကစားခဲ့တဲ့ ကစားသမားတော်တော်များများဟာ အသင်းရဲ့ အဓိက ကစားသမားအဖြစ်မဟုတ်တော့ဘဲ အရန် ကစားသမား အဆင့်လောက်နဲ့ သာ ပါဝင်အသုံးတော်ခံခွင့် ရခဲ့ကြသူတွေများပါတယ်။ \r\nခေတ်ပြိုင် တွေ ကိုယ်ထက် ငယ်ရွယ်သူ တွေ ဘောလုံးသမား ဘဝက အနားယူသူယူ နည်းပြလုပ်သူလုပ်နဲ့ အရေခွံလဲ နေကြချိန်မှာ ခုအချိန်ထိ ထိပ်တန်းလိဂ် တစ်ခုဖြစ်တဲ့ စီးရီးအေ ကလပ် အေစီမီလန် အသင်းမှာ အဓိက တိုက်စစ်မှုးအဖြစ် အသုံးတော်ခံနေဆဲ လူကောင်ထွားထွား လေလုံး ခပ်များများနဲ့ ဆွီဒင် သားဘောလုံးနတ်ဘုရားကြီး ဇလာတန် အေဗရာဟီမိုဗစ်ကတော့ မမောမပန်း ဘောလုံး ဆက်ကစားနေဆဲပါ ။ \r\nဇလာတန် အီဗရာဟီမိုဗစ်ဟာ ပြီးခဲ့တဲ့ အောက်တိုဘာ (၃၁) ရက်နေ့က အသက် (၄၀) ပြည့်ခဲ့ပါတယ်။ ဒါပေမယ့် ဘောလုံးလောက ရဲ့ အန္တရာယ်အကြီးမားဆုံး တိုက်စစ်မှုးစာရင်းမှာ သူပါဝင်နေဆဲပါ ။ သူဟာ လက်ရှိ နည်းပြတွေပြုလုပ်နေကြတဲ့ ဘိုင်ယန် နည်းပြ နာဂယ်စ်မန်းထက် (၆) နှစ် ၊ အာဆင်နယ်နည်းပြ အာတီတာထက် (၂) နှစ် ၊ ဒါဘီနည်းပြ ဝိန်းရွန်နီထက် (၄) နှစ် ပိုပြီးကြီးပါတယ်။ ဒါပေမယ့် ယခုအချိန်အထိ အေစီမီလန်အသင်းရဲ့တိုက်စစ်မှာ အဓိက ဦးဆောင်ကစားနေပြီး အသင်းရဲ့ ထိပ်တန်း ဂိုးသွင်းစက် အဖြစ်တံဆိပ်ခပ်နှိပ် ထားဆဲပါ ။ \r\nမနှစ်က ဘောလုံးရာသီမှာ အေစီအတွက် ဇလာတန်က ပြိုင်ပွဲစုံ (၃၈) ပွဲမှာ (၂၆) ဂိုးသွင်းခဲ့ပါတယ်။ သူသွင်းခဲ့တဲ့ (၂၆) ဂိုးမှာ (၅) ဂိုးသာ ပင်နယ်တီကနေ သွင်းယူခဲ့တာဖြစ်ပြီး ကျန်တဲ့ဂိုးတွေက ပွဲကစားချိန်အတွင်းမှာ သွင်းယူခဲ့တဲ့ ဂိုးတွေဖြစ်ပါတယ်။ ဇလာတန်ရဲ့ အသက်အရွယ်နဲ့ ကြံ့ခိုင်မှုဟာ မာကျောပါတယ်ဆိုတဲ့ အီတလီ ခံစစ်မှုးတွေတောင် ဖြိုလှဲရခက်တဲ့ ကြံခိုင်မှုမျိုးဖြစ်ပါတယ်။ ဇလာတန်ဟာ ဒဏ်ရာပြဿနာ တွေနဲ့ ကြုံတွေ့ခဲ့ရင်တောင်မှာ ပြင်းပြတဲ့စိတ်ဓာတ်ခွန်အားနဲ့ မြက်ခင်းစိမ်းတွေအပေါ် အလျှင်အမြန်ပြန်လာဖို့ အားထုတ်လေ့ရှိသူပါ ။ မန်ယူအသင်းမှာ ကစားစဉ်က ဇလာတန် ပြောခဲ့တဲ့စကားတစ်ခွန်းကို မှတ်မိနေပါသေးတယ်။ \r\n“ခြင်္သေ့ တွေဟာ လူတွေလို အနားယူချိန်အများကြီးမလိုပါဘူး ဆိုတဲ့စကားဘဲဖြစ်ပါတယ်”\r\nမန်ယူအသင်းမှာ ဒဏ်ရာကနေ အချိန်မတိုင်မှီ ပြန်လည်နလန်ထ လာတဲ့သူ့အပေါ်ကို မီဒီယာ တွေရဲ့ မေးမြန်းမှုကိုပြန်လည်ဖြေကြားခဲ့တဲ့စကားပါ ။ \r\nတစ်ကယ်လည်းဇလာတန် ဟာ ခြင်္သေ့ လို စိတ်ထားနဲ့ မြက်ခင်းစိမ်းပေါ် အမဲလိုက်ဖို့ အမြဲအားထုတ်နေခဲ့သူပါ ။ \r\nဇလာတန် က သူ့ကိုယ်သူ ယုံကြည်မှုလွန်ကဲစွာနဲ့ ဘောလုံးကမ္ဘာမှာ သူသာ အကောင်းဆုံးဆိုတဲ့စကားလုံးမျိုးတွေ မကြာခဏ သုံးစွဲလေ့ရှိပါတယ်။ ခေတ်စကားနဲ့ ဆိုရလျှင်တော့ ကြွယ်တယ်ပေါ့။ ဒါပေမယ့် ဇလာတန်ဟာ သူပြောတဲ့စကားလုံးတွေနဲ့ လိုက်ဖက်အောင် ပြင်းထန်တဲ့စိတ်ဓာတ်ခွန်အား ယုံကြည်မှုတွေနဲ့ကိုယ့်ကို ကိုယ် ပုံဖော်ထုဆစ်နေသူပါ ။ ', NULL, 5, 3, '0', '2021-11-04 06:30:25'),
(6, 'Gal Gadot to Play Evil Queen in Disney’s Live-Action ‘Snow White’', 'The Evil Queen is the one who steps to her Magic Mirror and famously asks, “Mirror, mirror, on the wall, who is fairest of them all?” And everyday, the Mirror responds to the Queen that it is she. When the day comes that it doesn’t, the Queen sets into a murderous tailspin that will involve a Huntsman, seven dwarves, a poisoned apple, and plenty of singing.', NULL, 5, 4, '0', '2021-11-04 06:45:31'),
(7, 'Music Box Takes North American Rights to Brazilian Fantasy Horror ‘Medusa’', 'Medusa, da Silveira’s follow-up to her well-received debut Kill Me Please, premiered in Cannes in the Directors’ Fortnight sidebar and had its North American premiere in Toronto. The film will screen at the AFI festival in Los Angeles on November 13.\r\n\r\nMedusa stars Mari Oliveira as Mariana, a 21-year-old trying to keep up appearances and resist temptation, particularly of a sexual nature. At night, she and her girlfriends team up, put on masks, and head out to hunt down and beat up women they judge as having deviated from the righteous path.', NULL, 4, 4, '0', '2021-11-04 06:49:51'),
(8, 'Cambodia Set to Take Global Stage Again as ASEAN Chair', 'For the next 365 days, every move Cambodia, especially Prime Minister Hun Sen, makes or takes will be scrutinized by strategists and political pundits around the world. Phnom Penh will be the new fulcrum in the post-pandemic era to which global leaders can converge and discuss their future, which could further intensify cooperation or tension. After nearly four decades of continuous power, Hun Sen’s brinkmanship is well known and most of all, he knows exactly what he wants to say and do. Uniquely, none of the regional leaders knows the region’s pulse and global politics as well as Hun Sen.', NULL, 1, 1, '0', '2021-11-03 19:11:54'),
(9, 'Huawei Promotion', 'In a media statement on Tuesday (July 30), the company explained that for the promotion on July 26, it had prepared about 2,000 sets of the Y6 Pro smartphones, to be sold at a discounted price of S$54.\r\nRead more at https://www.todayonline.com/singapore/huawei-offers-s100-voucher-5000-customers-make-things-right-after-botched-promotion', NULL, 1, 5, '0', '2021-11-03 19:12:37'),
(10, 'Antonio Conte: Tottenham head coach vows to bring consistency and play attractive football', 'Antonio Conte has signed an 18-month deal at the Tottenham Hotspur Stadium, replacing Nuno Espirito Santo who was sacked on Monday; Conte took charge of his first Spurs training session on Tuesday; \"My coaching philosophy is very simple - to play good and attractive football for our fans\"', NULL, 3, 3, '0', '2021-11-03 19:13:52'),
