(12, 'Cristiano Ronaldo phenomenal in saving Man Utd again but result papers over the cracks, says Paul Merson', 'Cristiano Ronaldo\'s late stunner rescued a 2-2 draw for Man Utd against Atalanta. \"It\'s got to be one of the best finishes of all-time,\" said Paul Merson. \"It\'s another Polyfilla one, it\'s just covering over the cracks, but it\'s a result.\"\r\n\r\nRonaldo, who had earlier finished off a flowing team move to cancel out Josip Ilicic\'s opener, rescued a point for Ole Gunnar Solskjaer\'s side with a stunning volley in the second minute of stoppage time after Duvan Zapata had put Atalanta back in front.', NULL, 5, 3, '0', '2021-11-04 06:30:25'),
(13, 'Gal Gadot to Play Evil Queen in Disney’s Live-Action ‘Snow White’', 'The Evil Queen is the one who steps to her Magic Mirror and famously asks, “Mirror, mirror, on the wall, who is fairest of them all?” And everyday, the Mirror responds to the Queen that it is she. When the day comes that it doesn’t, the Queen sets into a murderous tailspin that will involve a Huntsman, seven dwarves, a poisoned apple, and plenty of singing.', NULL, 5, 4, '0', '2021-11-04 06:45:31'),
(14, 'Music Box Takes North American Rights to Brazilian Fantasy Horror ‘Medusa’', 'Medusa, da Silveira’s follow-up to her well-received debut Kill Me Please, premiered in Cannes in the Directors’ Fortnight sidebar and had its North American premiere in Toronto. The film will screen at the AFI festival in Los Angeles on November 13.\r\n\r\nMedusa stars Mari Oliveira as Mariana, a 21-year-old trying to keep up appearances and resist temptation, particularly of a sexual nature. At night, she and her girlfriends team up, put on masks, and head out to hunt down and beat up women they judge as having deviated from the righteous path.', NULL, 4, 4, '0', '2021-11-04 06:49:51'),
(15, 'Cambodia Set to Take Global Stage Again as ASEAN Chair', 'For the next 365 days, every move Cambodia, especially Prime Minister Hun Sen, makes or takes will be scrutinized by strategists and political pundits around the world. Phnom Penh will be the new fulcrum in the post-pandemic era to which global leaders can converge and discuss their future, which could further intensify cooperation or tension. After nearly four decades of continuous power, Hun Sen’s brinkmanship is well known and most of all, he knows exactly what he wants to say and do. Uniquely, none of the regional leaders knows the region’s pulse and global politics as well as Hun Sen.', NULL, 1, 1, '0', '2021-11-03 19:11:54'),
(16, 'Huawei Promotion', 'In a media statement on Tuesday (July 30), the company explained that for the promotion on July 26, it had prepared about 2,000 sets of the Y6 Pro smartphones, to be sold at a discounted price of S$54.\r\nRead more at https://www.todayonline.com/singapore/huawei-offers-s100-voucher-5000-customers-make-things-right-after-botched-promotion', NULL, 1, 5, '0', '2021-11-03 19:12:37'),
