(37, 'COP26: Singapore commits to phasing out unabated coal power by 2050', '&lt;p style=&quot;box-sizing: inherit; margin-right: 0px; margin-bottom: 28px; margin-left: 0px; letter-spacing: -0.33px; color: rgb(0, 0, 0); font-family: sofia-pro, sans-serif; font-size: 19.2px;&quot;&gt;&lt;b&gt;SINGAPORE&lt;/b&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-right: 0px; margin-bottom: 28px; margin-left: 0px; letter-spacing: -0.33px; color: rgb(0, 0, 0); font-family: sofia-pro, sans-serif; font-size: 19.2px;&quot;&gt;Singapore will phase out the use of unabated coal by 2050, the Prime Minister&rsquo;s Office (PMO) announced on Thursday (Nov 4).&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-right: 0px; margin-bottom: 28px; margin-left: 0px; letter-spacing: -0.33px; color: rgb(0, 0, 0); font-family: sofia-pro, sans-serif; font-size: 19.2px;&quot;&gt;Unabated coal refers to the burning of coal without carbon capture and storage, a process of capturing and storing carbon dioxide before it can be released into the atmosphere.&lt;/p&gt;', NULL, 1, 1, '0', '2021-11-04 12:00:10');
