(46, 'Self Study လုပ်တဲ့အခါမှာ မဖြစ်မနေသိထားသင့်တဲ့ အချက် ၄ ချက်', '&lt;p&gt;&lt;img src=&quot;data:image/png;base64,&quot; data-filename=&quot;image-25.png&quot; style=&quot;font-size: 1rem; width: 100%;&quot;&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(53, 55, 58); font-family: Georgia, Times, serif; font-size: 21px;&quot;&gt;ကိုယ်သင်ယူချင်တာကို အင်တာနက်ကနေ ဘာမဆို အလွယ်တကူ ကိုယ်တိုင် လေ့လာလို့ရနေတဲ့ ခေတ်ကြီးမှာ လူငယ်တွေဟာ ကိုယ်တတတ်မြောက်ချင်တဲ့ ပညာရပ်ကို ကိုယ်တိုင်ရှာဖွေ လေ့လာနေကြပါပြီ။ Covid လိုရောဂါကပ်ဆိုးကြီးကြောင့်လည်း Online Learning culture က ပိုတိုးတက်လာတယ်။ အင်တာနက်ကနေလည်း သင်ယူစရာဘာသာရပ်တွေ၊ သင်တန်းတွေ၊ Skills တွေ အများမှ အများကြီးပါပဲ။ Resources တွေကလည်းပေါပါတယ်။ တစ်ချို့ 100% FREE ရတယ်။ skillshare လို Linkedin လိုမှာဆိုရင် တစ်လကို ဘယ်လောက် သင်တန်းတစ်ခုကို ဘယ်လောက်ပေးရတယ်ဆိုပြီး ရှိပါတယ်။&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit; color: rgb(53, 55, 58); font-family: Georgia, Times, serif; font-size: 21px;&quot;&gt;&lt;span style=&quot;color: rgb(53, 55, 58); font-family: Georgia, Times, serif; font-size: 21px;&quot;&gt;ဒါပေမယ့် ကိုယ်ကိုတိုင် တစ်ယောက်ထဲ လေ့လာရတာဖြစ်လို့ အားပိုစိုက်ရသလို စည်းကမ်းရှိရှိ စနစ်ကျကျ လေ့လာမှပဲ ကိုယ်သင်ကြားတဲ့ဘာသာရပ်ကို သေချာသင်ကြားတတ်မြောက်နိုင်မှာဖြစ်ပါတယ်။&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;data:image/png;base64,&quot; style=&quot;width: 100%;&quot; data-filename=&quot;image-27.png&quot;&gt;&lt;span style=&quot;color: rgb(53, 55, 58); font-family: Georgia, Times, serif; font-size: 21px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(53, 55, 58); font-family: Georgia, Times, serif; font-size: 21px;&quot;&gt;ပထမဆုံးအနေနဲ့ ကိုယ်ဘယ်ဘာသာကို သင်ယူချင်လဲဆိုတာကို သေချာဆုံးဖြတ်ပါ။ စိတ်ဝင်စားစရာဘာသာရပ်တွေကော သင်ယူစရာဘာသာရပ်တွေကော အရမ်းများနေတဲ့ခေတ်ကြီးမှာ ကိုယ်တကယ်စိတ်ပါဝင်စားတဲ့ ဘာသာရပ်ကို သေချာစိစစ်ရွေးချယ်နိုင်ပါမှ အချိန်ကုန်လူပန်းသက်သာမှာဖြစ်ပါတယ်။ကိုယ်သင်ယူချင်တဲ့ ဘာသာရပ်ကို တွေ့ပြီဆိုတာနဲ့ ဘယ်ကနေသင်ယူမလဲ။ Youtube ကနေလား။ တခြား Learning Platform တွေကနေလား။ အဲPlatform တွေမှာလည်း Subject တစ်ခုဆိုရင်လည်း အဲဒါနဲ့ သက်ဆိုင်တဲ့ Level နဲ့လိုက်ပြီးပဲဖြစ်ဖြစ် အမျိုးအစားနဲ့လိုက်ပြီးပဲဖြစ်ဖြစ် Lessons တွေအများကြီးရှိပါတယ်။ ကိုယ်အချိန်ဘယ်လောက်ပေးပြီး လေ့လာမလဲ။ ကိုယ်ဘယ်လောက် Effort စိုက်ထုတ်ပြီး လေ့လာမလဲဆိုတာပေါ်မူတည်ပြီး ရွေးချယ်ပေးရမှာဖြစ်ပါတယ်။&lt;/span&gt;&lt;span style=&quot;color: rgb(53, 55, 58); font-family: Georgia, Times, serif; font-size: 21px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;', NULL, 1, 2, '0', '2021-11-04 15:40:27');
INSERT INTO `posts` (`id`, `title`, `description`, `ordering`, `user_id`, `category_id`, `is_publish`, `created_at`) VALUES
(47, 'JavaScript and JQuery: Interactive Front-End Web Development', '&lt;p style=&quot;padding: 0px; margin-right: 0px; margin-bottom: 14px; margin-left: 0px; color: rgb(15, 17, 17); font-family: Arial, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;Learn JavaScript and jQuery a nicer way&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin: -4px 0px 14px; color: rgb(15, 17, 17); font-family: Arial, sans-serif; font-size: 14px;&quot;&gt;This full-color book adopts a visual approach to teaching JavaScript &amp;amp; jQuery, showing you how to make web pages more interactive and interfaces more intuitive through the use of inspiring code examples, infographics, and photography. The content assumes no previous programming experience, other than knowing how to create a basic web page in HTML &amp;amp; CSS. You&#039;ll learn how to achieve techniques seen on many popular websites (such as adding animation, tabbed panels, content sliders, form validation, interactive galleries, and sorting data)..&lt;/p&gt;&lt;ul style=&quot;margin-right: 0px; margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); padding: 0px; font-family: Arial, sans-serif; font-size: 14px;&quot;&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;Introduces core programming concepts in JavaScript and jQuery&lt;/li&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;Uses clear descriptions, inspiring examples, and easy-to-follow diagrams&lt;/li&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;Teaches you how to create scripts from scratch, and understand the thousands of JavaScripts, JavaScript APIs, and jQuery plugins that are available on the web&lt;/li&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;Demonstrates the latest practices in progressive enhancement, cross-browser compatibility, and when you may be better off using CSS3&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 100%;&quot; data-filename=&quot;img1.jpg&quot;&gt;&lt;br&gt;&lt;/p&gt;', NULL, 3, 2, '0', '2021-11-09 15:27:07');
INSERT INTO `posts` (`id`, `title`, `description`, `ordering`, `user_id`, `category_id`, `is_publish`, `created_at`) VALUES
(48, 'iOS 15.2 release date rumors, news and all the new features coming to your iPhone', '&lt;p&gt;&lt;img src=&quot;data:image/webp;base64,&quot; style=&quot;width: 100%;&quot; data-filename=&quot;vXV7DCWDX7Z4XufT6nTG4E-1024-80.jpg.webp&quot;&gt;&lt;/p&gt;&lt;p style=&quot;margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.5; font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);&quot;&gt;iOS 15.2 is on the way and it&rsquo;s surprisingly packed with features &ndash; though mostly smaller ones than those introduced in&amp;nbsp;&lt;a href=&quot;https://www.techradar.com/news/ios-151-news&quot; data-component-tracked=&quot;1&quot; class=&quot;hawk-link-parsed&quot; style=&quot;margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(47, 110, 145);&quot;&gt;iOS 15.1&lt;/a&gt;.&lt;/p&gt;&lt;div id=&quot;ad-unit-1&quot; class=&quot;ad-unit&quot; style=&quot;margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);&quot;&gt;&lt;/div&gt;&lt;div id=&quot;bordeaux-static-slot-6&quot; class=&quot;bordeaux-slot&quot; data-feat-ref=&quot;bordeaux-feat-id-134&quot; style=&quot;margin: auto; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); display: flex; flex-direction: column;&quot;&gt;&lt;/div&gt;&lt;p style=&quot;margin-right: 0px; margin-bottom: 1em; margi